import React from "react";
import Link from 'next/link';
import styled from "styled-components";

const BasicNavigation = styled.ul`
  width:320px;
  background:red;

  .nav_list{
    display:none; 
  }
`;

const BasicNav = () => {
  return (
    <BasicNavigation>
      <div className='menu_icon'>  

      </div>
      <ul className="nav_list">
        <li><Link href=''><a>Nav1</a></Link></li>
        <li><Link href=''><a>Nav2</a></Link></li>
        <li><Link href=''><a>Nav3</a></Link></li>
        <li><Link href=''><a>Nav4</a></Link></li>
        <li><Link href=''><a>Nav5</a></Link></li> 
      </ul>
    </BasicNavigation>
  )
}

export default BasicNav;
